import React from 'react';
import TF from './../tficon.svg';
import Keras from './../kerasicon.svg';

const Skills = () => {
	return(
		<div className='ph5'>
			<div className='pa3 tc'>
				<h1>Skills</h1>
			</div>
			<div className='flex'>
				<div className='tc pa3 mr2'>
					<i className="devicon-python-plain-wordmark colored" style={{'font-size':'6em'}}></i>
					<h4>Python</h4>
				</div>
				<div className='tc pa3 mr2'>
					<img src={TF} alt='tf' style={{'width':'6em','height':'5.8em'}}/>
					<h4>Tensorflow</h4>
				</div>

				<img src={TF} alt='tf' style={{'width':'5em','height':'5em'}}/>
				<img src={Keras} alt='keras' style={{'width':'5em', 'height':'5em'}}/>
			</div>
		</div>

	);
}

export default Skills;
